			function trWeather(options) {
				
				// ensure this is called as constructor
				
				if (!(this instanceof trWeather)) {
					return new trWeather(options);
				}
				
				var weather = this;
				
				this.timestamp = undefined;
				this.api_key = undefined;
				
				this.icon_labels = {
					"clear-day": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"clear-night": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"rain": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"snow": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"sleet": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"wind": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"fog": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"cloudy": '<img alt="Your converted image" src="data:image/png;base64,">', 
					"partly-cloudy-day": '<img alt="Your converted image" src="data:image/png;base64,">',
					"partly-cloudy-night": '<img alt="Your converted image" src="data:image/png;base64,">'
				}
				

				// accessors
				this.get_summary_forecast = function() {
					return weather.summary;
				}
				
				this.get_icon = function() {
					if (weather.icon_labels[weather.icon]) {
						return weather.icon_labels[weather.icon];
					} else {
						return "";
					}
				}
				
				this.get_temperature = function() {
					return weather.temperature;
				}
				
				this.weather_is_current = function() {
					if (typeof weather.timestamp == "undefined") {
						// haven't gotten a forecast yet
						return false;
					}
					
					var age_of_forecast = new Date() - weather.timestamp;
					if (age_of_forecast > 15*60*1000) {
						// forecast is more than 15 minutes old
						return false;
					}
					
					return true; // recent enough!
				}			

				
				this.update_forecast = function() {
					
					var weather_url = "https://api.forecast.io/forecast/"+weather.api_key+"/"+options.lat+","+options.lng;
					
					if (location.search.match("weatherproxy") !== null) {
						weather_url = "http://transitappliance.com/cgi-bin/weather_proxy.pl?key="+weather.api_key+"&lat="+options.lat+"&lng="+options.lng;
					}
	
		      jQuery.ajax({
						url: weather_url,
						dataType: "jsonp",
						success: function(data){
							if (data.minutely) {
								weather.summary = data.minutely.summary;
								weather.temperature = Math.floor(data.currently.temperature + 0.5)+"&deg;";
								weather.icon = data.minutely.icon;
								weather.timestamp = new Date();
							}
						}

					});
				}
				
				this.get_api_key = function() {
		      jQuery.ajax({
						url: "http://transitappliance.com/cgi-bin/get_weather_key.pl?id="+options.id,
						dataType: "json",

						success: function(data){
							if (data.api_key) {
								weather.api_key = data.api_key;
								weather.update_forecast();				
								setInterval(function() {weather.update_forecast()}, 5*60*1000); // update every five minutes
							} else {
								// try later
								setTimeout(function() {
									weather.get_api_key();
								},5*60*1000);
							}
						},
						
						error: function() {
							// try later
							setTimeout(function() {
								weather.get_api_key();
							},5*60*1000);
						}
					});
				}
				
				weather.get_api_key();

				
			}		